jQuery(document).ready(function ($) {
  intiVideomodal()
  initSlick()
  initAccoridon()
  initIsotope()
})

function initIsotope () {
  if (jQuery('div').is('.isotope')) {
    var $container = jQuery('.isotope').isotope({
      itemSelector: '.col-md-4',
      percentPosition: true
    })

    var initShow = 9 // number of items loaded on init & onclick load more button
    var counter = initShow // counter for load more button
    var iso = $container.data('isotope') // get Isotope instance

    loadMore(initShow) // execute function onload

    function loadMore (toShow) {
      $container.find('.hidden').removeClass('hidden')

      var hiddenElems = iso.filteredItems.slice(toShow, iso.filteredItems.length).map(function (item) {
        return item.element
      })
      $(hiddenElems).addClass('hidden')
      $container.isotope('layout')

      if (hiddenElems.length == 0) {
        jQuery('#load-more').hide()
      } else {
        jQuery('#load-more').show()
      };
    }

    $container.after('<div class="text-center"><a href="#" class="btn btn-gray" id="load-more">Load More</a></div>')

    $('#load-more').click(function () {
      counter = counter + initShow
      loadMore(counter)

      return false
    })
  }
}

// bootstrap modal video
function intiVideomodal () {
  var holder = jQuery('.modal')
  var iframe = holder.find('iframe')
  var url = iframe.prop('src')

  holder.on('hide.bs.modal', function () {
    iframe.attr('src', url)
  })

  holder.on('show.bs.modal', function () {
    iframe.attr('src', url + '?rel=0&autoplay=1')
  })
}

function initSlick () {
  jQuery('.gallery-speaker').slick({
    infinite: true,
    slidesToShow: 3,
    slidesToScroll: 3,
    appendArrows: jQuery('<div class=\'new-arrows\'></div>').appendTo('.gallery-speaker-container .heading'),
    centerMode: true,
    responsive: [
      {
        breakpoint: 1200,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2
        }
      },
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          centerPadding: '40px'
        }
      }
    ]
  })

  jQuery('.gallery-conference').slick({
    dots: true,
    arrows: true,
    infinite: true,
    speed: 500,
    fade: true,
    cssEase: 'linear',
    customPaging: function (slider, i) {
      var title = $(slider.$slides[i]).data('title')
      return '<span>' + title + '</span>'
    },
    nextArrow: '.gallery-conference-container .slick-next'
  }).on('afterChange', function (event, slick, currentSlide, nextSlide) {
    jQuery('.paging .dots li.slick-active').removeClass('slick-active').siblings().addClass('slick-active')
  })

  jQuery('.go-to-slide-1').click(function () {
    jQuery('.gallery-conference').slick('slickGoTo', 0)
    return false
  })
  jQuery('.go-to-slide-2').click(function () {
    jQuery('.gallery-conference').slick('slickGoTo', 1)
    return false
  })
}

function initAccoridon () {
  jQuery('.accordion li').each(function () {
    var holder = jQuery(this),
      opener = holder.find('.opener'),
      parent = holder.find('.slide').hide()

    opener.click(function () {
      $parent = jQuery(this).closest('.opener-wrap').parent()
      $parent.toggleClass('active')
      $parent.find('.slide').slideToggle()
      return false
    })
  })

  jQuery('.accordion .active .slide').show()
}

$('#location').click(function () {
  $('html,body').animate({
    scrollTop: $('#location-section').offset().top},
  'slow')
})

$('#scroll-arrow').click(function () {
  $('html,body').animate({
    scrollTop: $('#location-section').offset().top},
  'slow')
})

